n, k = map(int, input().split())
a = list(map(int, input().split()))

dp = [[0 for i in range(k + 1)] for j in range(n + 1)]

for i in range(1, n + 1):
	dp[i][0] = i

for i in range(1, n + 1):
	for j in range(1, k + 1):
		if j > i:
			dp[i][j] = dp[i - 1][j] + a[i - 1] // j
		else:
			dp[i][j] = min(dp[i][j], dp[i - 1][j])

print(dp[n][k])
